const mongoose = require('mongoose')
// mkdir -p uploads   to create new file uploads || mdkir uploads

const serviceSchema = new mongoose.Schema({
    
    category :{ type: String, required: [true, 'category field is required']},
    serviceName :{ type: String, required: [true, 'name field is required']},
    price :{ type: Number, required: true},
    qty :{ type: Number },
    unit :{ type: String, required: true},

    serviceNo :{ type: String },
    status: { type: String, default: 'Available'},
    image : { type : String , default :"data:image/jpeg;base64,"},
    // used https://www.base64-image.de/ in google : image to data base64
    
    user: { type: mongoose.Schema.Types.String, ref: 'User'},
  

}, { timestamps :true})

module.exports = mongoose.model('Service', serviceSchema);
